function [sys]=DefineDisturbance(sys)
% 定义匹配干扰
t_start_disturbance = 0; % 干扰开始的时间
disturbance_amplitude = [1000000;700000;700000;1000000;700000;0]*0.1; % 干扰的幅值
t_end_disturbance = 5;
sys.match_distur = @(t) disturbance_amplitude * (t >= t_start_disturbance && t <=t_end_disturbance);
